import React from 'react'

const Cart = ({cart}) => {
  return (
    <div>
      <h2>Cart</h2>
      <div>{cart.map((data)=>{
        return(
          <>
            <div></div>
          </>
        )
      })}</div>
    </div>
  )
}

export default Cart
